import React from "react";
import { Line } from "react-chartjs-2";

function Chart() {
  const data = {
    labels: ["Jan", "Feb", "March", "Apr", "May"],
    datasets: [
      {
        label: "Sales",
        data: [1, 5, 3, 7, 5],
      },
    ],
  };

  return <Line data={data} />;
}

export default Chart;
